import {} from ""

const DUMMYEVENTS = [
    {
        id: "e1",
        title: "Some event",
    },
    {
        id: "e2",
        title: "Another event",
    },
]

function EventsPage() {
    return (
        <>
            <h1>EventsPage</h1>
            {DUMMYEVENTS.map(event => <li key={event.id}></li>)}
        </>
    )
}

export default EventsPage;
